class Solution {
    public boolean checkInclusion(String s1, String s2) {
        
        if(s1.equals("") || s1.equals("")||s1.equals("")||s1.equals("")||s1.equals(""))
            return true;
        
        
        int k = s1.length();
        if(s2.length()<k)
            return false;
        Map<Character,Integer> mp = new HashMap<>();
        Map<Character,Integer> mp2 = new HashMap<>();
        int lc=0;
        for(int i=0;i<s1.length();i++){
            mp.put(s1.charAt(i),mp.getOrDefault(s1.charAt(i),0)+1);        
        }
        lc = mp.size();
        for(int i=0;i<k;i++){
            char ch = s2.charAt(i);
            mp2.put(ch,mp2.getOrDefault(ch,0)+1);
            if(mp2.get(ch)==mp.get(ch))
                lc--;
        }
        if(lc==0)
            return true;
        for(int i=k;i<s2.length();i++){
            char ch = s2.charAt(i);
            if(mp.get(s2.charAt(i-k))!=null && mp2.get(s2.charAt(i-k))==mp.get(s2.charAt(i-k))){
                //System.out.println(s2.charAt(i-k)+" "+mp2.get(s2.charAt(i-k)));
                lc++;
            }
            mp2.put(s2.charAt(i-k),mp2.get(s2.charAt(i-k))-1);
            
            mp2.put(ch,mp2.getOrDefault(ch,0)+1);
            if(mp2.get(ch)==mp.get(ch))
                lc--;
            if(lc==0)
                return true;
            //System.out.println((i-k+1)+" "+i+" "+lc);
        }
        return false;
    }
}
